import React from 'react';
import cloudLogo from "./cloud.png";
import { Link } from 'react-router-dom';
export default function Navbar() {
  return (
    <nav className="text-white py-5 px-7 shadow-md" style={{
      background: `linear-gradient(90deg, rgba(15,209,139,1) 0%, rgba(48,219,201,1) 63%, rgba(69,249,252,1) 100%)`
    }}>
      <div className="container mx-auto flex justify-between items-center">
        <img src={cloudLogo} alt="CloudNotes Logo" className="h-8 w-8" />
        {/* Website Name */}
        

        {/* Navigation Links */}
        <div className="space-x-4">
        <Link to='/login'>
            <button className="text-white font-bold px-4 py-1 rounded-md transition"
              style={{
                background: `linear-gradient(90deg, rgba(15,209,139,1) 0%, rgba(0,0,0,1) 0%)`
              }}
            >
              Login
            </button>
          </Link>
          <Link to='/signup'>
            <button className="text-white px-4 py-1 rounded-md font-bold transition"
              style={{
                background: `linear-gradient(90deg, rgba(15,209,139,1) 0%, rgba(0,0,0,1) 0%)`
              }}
            >
              SignUp
            </button>
          </Link>
         
        </div>
      </div>
    </nav>
  );
}
